  public void testBoardSize() {
    assertThrows(InvalidBoardString.class, () -> {
      new Connect4((byte) 3, (byte) 3);
    });
    assertThrows(InvalidBoardString.class, () -> {
      new Connect4((byte) 3, (byte) 3, true);
    });
    assertThrows(InvalidBoardString.class, () -> {
      new Connect4("eeeeeeee", (byte) 3, (byte) 4);
    });
    assertThrows(InvalidBoardString.class, () -> {
      new Connect4("eeeeeeee", (byte) 3, (byte) 4, true);
    });
  }

